@Laet_de_r @PasquierA @LB2S C'est bon là, ça frôle l'overdose ! 
A quand une perfusion du vaccin avec un petit réservoir et une aiguille dans le bras et tout les 2 jours tu dois refaire le plein dans une station agréé. 
